import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { VesRecordDeleteComponent } from '../ves-record-delete/ves-record-delete.component';
import { VesRecordEditComponent } from '../ves-record-edit/ves-record-edit.component';
import { VesComponent } from '../ves.component';
import { CreateVesRequestComponent } from '../create-ves-request/create-ves-request.component';
import { AmendVesRequestComponent } from '../amend-ves-request/amend-ves-request.component';
import { PendingVesRequestComponent } from '../pending-ves-request/pending-ves-request.component';
import { ApproveVesRequestComponent } from '../approve-ves-request/approve-ves-request.component';

const vesRoute: Routes = [
  {
    path: '',
    component: VesComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/edit/:id',
    component: VesRecordEditComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.ves.edit.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/delete',
    component: VesRecordDeleteComponent,
    data: {
      defaultSort: 'id.asc',
      pageTitle: 'nspay2App.payroll.ves.delete.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/create',
    component: CreateVesRequestComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.ves.create-ves-request.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/amend/:id',
    component: AmendVesRequestComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.ves.amend-ves-request.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/pending/:id',
    component: PendingVesRequestComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.ves.pending-ves-request.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'request/approve/:id',
    component: ApproveVesRequestComponent,
    data: {
      defaultSort: 'id,asc',
      pageTitle: 'nspay2App.payroll.ves.approve-ves-request.title'
    },
    canActivate: [UserRouteAccessService]
  }
];

@NgModule({
  imports: [RouterModule.forChild(vesRoute)],
  exports: [RouterModule]
})
export class VesRoutingModule {
}
